import React from 'react';
import PropTypes from 'prop-types';
import 'antd/dist/antd.css';


const UStore = ({ Component }) => {
    return (
    <Component />
    )
};

UStore.propTypes = {
    Component: PropTypes.elementType.isRequire,
}

export default UStore;
